def isValid(s):
    letters = {}
    for letter in s:
        if letter in letters:
            letters[letter] += 1
        else:
            letters[letter] = 1

    print(letters)
    values = list(letters.values())
    values.sort()

    maxv = max(values)
    minv = min(values)
    length = len(values)

    print(values)

    if (values.count(values[0]) == length):
        return "YES"
    elif ((values.count(minv) == 1) and (values.count(maxv) == (length - 1)) and (maxv == minv + 1)):
        return "YES"
    elif ((values.count(maxv) == 1) and (values.count(minv) == (length - 1)) and (minv == maxv - 1)):
        return "YES"
    elif ((values.count(minv) == 1) and (values.count(maxv) == (length - 1)) and (minv == 1)):
        return "YES"
    else:
        return "NO"

test = ""

print(isValid(test))
